function reloadContract(contractname, contractAddress) {
    if (contractname=="vnodeprotocolbase") {
        var vnodeprotocolbaseABI = compiledContracts['VnodeProtocolBase']['interface']
        return chain3.mc.contract(vnodeprotocolbaseABI).at(contractAddress);
    }

    if (contractname=="subchainbase") {
        var subchainbaseABI = compiledContracts['SubChainBase']['interface']
        return chain3.mc.contract(subchainbaseABI).at(contractAddress);
    }

    if (contractname=="subchainprotocolbase") {
        var subchainprotocolbaseABI = compiledContracts['SubChainProtocolBase']['interface']
        return chain3.mc.contract(subchainprotocolbaseABI).at(contractAddress);
    }

    console.log("Unknown contract name")
}

