function sendtxsubchain(src, tgtaddr, amount, strData, shardingflag, via, nonce) {
	mc.sendTransaction(
		{
			from: src,
			value:chain3.toSha(amount,'mc'),
			to: tgtaddr,
			gas: "0",
			gasPrice: 0,
			data: strData,
            shardingFlag: shardingflag,
            via: via,
            nonce: nonce
		}, function (e, transactionHash){
            if (!e) {
                console.log('Transaction hash: ' + transactionHash);
            }
            else
            {
                console.log('Error:' + e);
            }
        });
	console.log('sending from: ' + 	src + ' to: ' + tgtaddr  + ' amount:' + amount + ' with shardingflag ' + shardingflag.toString() + ' with data:' + strData + ' via: '+ via);
}

function sendtx(src, tgtaddr, amount, strData) {
	mc.sendTransaction(
		{
			from: src,
			value:chain3.toSha(amount,'mc'),
			to: tgtaddr,
			gas: "2000000",
			gasPrice: chain3.mc.gasPrice,
			data: strData
		}, function (e, transactionHash){
            if (!e) {
                console.log('Transaction hash: ' + transactionHash);
            }
            else
            {
                console.log('Error:' + e);
            }
        });
	console.log('sending from: ' + 	src + ' to: ' + tgtaddr  + ' amount:' + amount + ' with data:' + strData);
}
